      <Textarea label="Field Label" required />
      <br />
      <Textarea label="Field Label" size="large" required />
      <br />
      <Textarea label="Field Label" variant="warning" type="email" />
      <br />
      <Textarea label="Field Label" type="email" fullWidth />
    </>
  );
}
